plane_xz = random(-0.8, 0.8);
plane_yz = random(-0.8, 0.8);
plane_zx = random(-0.8, 0.8);
plane_xy = random(-0.8, 0.8);
intersect_c = random(-0.8, 0.8);
intersect_z = random(-0.8, 0.8);
cat = p.x + intersect_c * sin(tan(3.0 * p.y));
cat = p.y + intersect_z * sin(tan(3.0 * p.x));
astroid = p.x + plane_xz * sin(p.y * (1.0 / (plane_zx * plane_xy) ));
astroid = p.y + plane_yz * sin(p.x * (1.0 / (plane_xy * plane_zx) ));
xt = cat + astroid
yt = cat + astroid
